export function Initialize()
{
	sendPacketString("00 80 80",5);
		device.pause(100);
	sendPacketString("00 80 02 00 00 00",5);
		device.pause(100);
	sendPacketString("00 80 02 00 00 00",5);
		device.pause(100);
	sendPacketString("00 00 00 00 00",5);
		device.pause(100);
}

function sendPacketString(string, size){
    var packet= [];
    var data = string.split(' ');
    
    for(let i = 0; i < data.length; i++){
        packet[i] = parseInt(data[i],16);
    }

	device.write(packet, size);

}


